import React from "react";
import './index.css';

function SportsTitleOption (){
    return (
        <div className="sports-option-title-container">
            <div className="sports-option-title-block">
                <div className="sports-option-title">All</div>
                <div className="sports-option-title">Rent</div>
                <div className="sports-option-title">To Buy</div>
            </div>
        </div>
    );
}

export default SportsTitleOption;
